  false,\n\t\"url\": null,\n\t\"notes\": \"A review of known literature on Lahontan
  Valley marshlands was made by The Nature Conservancy in preparation for the Stillwater
  Water Management Analysis Scoping  Workshop held in Fallen, Nevada, 17-19 November
  1992. The objectives of the literature  review were to evaluate the existing information
  for its value to three levels of management  needs, including: 1) day-to-day marsh
  management operations and modeling at Stillwater  National Wildlife Refuge; 2) coordinated
  marsh management of three primary wetland  areasu2014Stillwater Refuge, Carson.
  Lake, and Fallon Indian Reservation; and 3) an assessment  of biological diversity
  for the entire Lahontan Valley.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
